import React from 'react';
import './ReviewImage.css'
const ReviewItem = ({product}) => {
    const {name,quantity,price,img} = product;
    return (
        <div className='review-item'>
            <div>
                <img src={img} alt="" />
            </div>
            <div className='review-details-container'>
                <h2>{name}</h2>
                <p>{price}</p>
                <p>{quantity}</p>
            </div>
            <div>
                <button></button>
            </div>
        </div>

    );
};

export default ReviewItem;
